import { memo, VFC, useEffect } from "react";
import { useSearchParams } from "react-router-dom";
import { PlayerCard } from "../organisms/player/PlayerCard";
import { use42Player } from "../../hooks/use42Player";

export const Home: VFC = memo(() => {
	const [searchParams] = useSearchParams();
	const code = searchParams.get("code");

	const { getPlayer, player } = use42Player();

	useEffect(() => {
		getPlayer(code!);
	}, [getPlayer]);

	if (!player) {
		return (
			<PlayerCard
				imageUrl="https://source.unsplash.com/random"
				id={"aaaa"}
				name={"hogehoge"}
				win={100}
				lose={50}
				level={42}
				exp={4242}
			/>
		);
	} else {
		return (
			<PlayerCard
				imageUrl={player.imageUrl!}
				id={player.id}
				name={player.name}
				win={player.win}
				lose={player.lose}
				level={player.level}
				exp={player.exp}
			/>
		);
	}
});
